import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import {Link} from "react-router-dom";
import {Layout, Navigation, Content} from "react-mdl";
import Router from './Router';
import '../Styles/Common.css';
import BottomBar from './BottomBar';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

class NavBar extends React.Component {

  handleItemClick = (e, { name }) => {}
  render() {
    const classes = useStyles();

    return (
      <Layout fixedHeader style={{backgroundColor: 'black', width: '100%'}}>
        <AppBar className={'bg-color2'} position="static">
          <Toolbar>
            <Typography variant="Button" className={classes.title}>
              <h4 style={{margin: '0px', marginLeft: '5%'}}>Ajinkya
                Malhotra</h4>
            </Typography>
            <Navigation style={{marginRight: "5%"}}>
              <Link to={"/"}>
                <Button color="inherit">Home</Button>
              </Link>
              <Link to="/projects">
                <Button color="inherit">Projects</Button>
              </Link>
              <a href="http://localhost:3000/resume.pdf"
                 rel="noopener noreferrer" target="_blank">
                <Button color="inherit">Resume</Button>
              </a>
              <Link to="/aboutme">
                <Button color="inherit">About Me</Button>
              </Link>
              <Link to="/contact">
                <Button color="inherit">Contact Me</Button>
              </Link>
            </Navigation>
          </Toolbar>
        </AppBar>
        <Content style={{padding: '10px'}}>
          <Router/>
        </Content>
        <BottomBar/>
      </Layout>
    );
  }
}

export default Navigation;


